import React, { useEffect, useState } from "react";
import axios from "axios";
import { Card } from "../../components/UI";

function AdminDashboard() {
  const [users, setUsers] = useState([]);
  const [trainers, setTrainers] = useState([]);
  const [workouts, setWorkouts] = useState([]);
  const [diets, setDiets] = useState([]);

  useEffect(() => {
    // ✅ Fetch all users
    axios.get("http://localhost:8080/api/users")
      .then(res => setUsers(res.data))
      .catch(err => console.error("Error fetching users:", err));

    // ✅ Fetch all trainers
    axios.get("http://localhost:8080/api/trainers")
      .then(res => setTrainers(res.data))
      .catch(err => console.error("Error fetching trainers:", err));

    // ✅ Fetch all workouts
    axios.get("http://localhost:8080/api/workouts")
      .then(res => setWorkouts(res.data))
      .catch(err => console.error("Error fetching workouts:", err));

    // ✅ Fetch all diets
    axios.get("http://localhost:8080/api/diets")
      .then(res => setDiets(res.data))
      .catch(err => console.error("Error fetching diets:", err));
  }, []);

  const clearAllData = () => {
    if (!window.confirm("Clear all data from database?")) return;

    Promise.all([
      axios.delete("http://localhost:8080/api/users/all"),
      axios.delete("http://localhost:8080/api/trainers/all"),
      axios.delete("http://localhost:8080/api/workouts/all"),
      axios.delete("http://localhost:8080/api/diets/all"),
      axios.delete("http://localhost:8080/api/progress/all"),
      axios.delete("http://localhost:8080/api/bmi/all")
    ])
      .then(() => {
        alert("All data cleared.");
        window.location.reload();
      })
      .catch(err => {
        console.error("Error clearing data:", err);
        alert("Failed to clear data.");
      });
  };

  return (
    <div className="container">
      <h2>Admin Dashboard</h2>

      <div className="row">
        <div className="col">
          <Card title="Users">
            <div className="list">
              {users.map(u => (
                <div className="list-item" key={u.id}>
                  <div><strong>{u.name}</strong> <span className="helper">({u.email})</span></div>
                  <div className="helper">Role: {u.role}</div>
                </div>
              ))}
              {!users.length && <div style={{ padding: 12 }}>No users.</div>}
            </div>
          </Card>
        </div>
        <div className="col">
          <Card title="Trainers">
            <div className="list">
              {trainers.map(t => (
                <div className="list-item" key={t.id}>
                  <div><strong>{t.name}</strong> <span className="helper">({t.email})</span></div>
                  <div className="helper">Specialization: {t.specialization}</div>
                </div>
              ))}
              {!trainers.length && <div style={{ padding: 12 }}>No trainers.</div>}
            </div>
          </Card>
        </div>
      </div>

      <div className="row" style={{ marginTop: 12 }}>
        <div className="col">
          <Card title="Workouts">
            <div className="helper">Total: {workouts.length}</div>
            <div className="list" style={{ marginTop: 8 }}>
              {workouts.slice(0, 6).map(w => (
                <div className="list-item" key={w.id}>
                  <div>{w.exercise} • {w.sets}×{w.reps} • {w.duration} min</div>
                  <div className="badge">{w.done ? "Done" : "Pending"}</div>
                </div>
              ))}
              {!workouts.length && <div style={{ padding: 12 }}>No workouts.</div>}
            </div>
          </Card>
        </div>
        <div className="col">
          <Card title="Diet Plans">
            <div className="helper">Total: {diets.length}</div>
            <div className="list" style={{ marginTop: 8 }}>
              {diets.slice(0, 6).map(d => (
                <div className="list-item" key={d.id}>
                  <div>{d.mealType} — {d.foodItem}</div>
                  <div>{d.calories} kcal</div>
                </div>
              ))}
              {!diets.length && <div style={{ padding: 12 }}>No diets.</div>}
            </div>
          </Card>
        </div>
      </div>

      <div style={{ marginTop: 12 }}>
        <button className="btn-danger" onClick={clearAllData}>Clear All Data</button>
      </div>
    </div>
  );
}

export default AdminDashboard;
